import React from "react";
import classes from "./Card.css";

function Card() {
  fetch(
    "https://rapidapi.p.rapidapi.com/media_comments?short_code=CB_B4z_s-0r&next_cursor=OPTIONAL",
    {
      method: "GET",
      headers: {
        "x-rapidapi-host": "instagram28.p.rapidapi.com",
        "x-rapidapi-key": "045abc2080mshfbe8d063d138733p135fc0jsna6e0c006cf7a",
      },
    }
  )
    .then((response) => {
      console.log(response);
    })
    .catch((err) => {
      console.error(err);
    });

  return <div className={classes.Card}></div>;
}

export default Card;
